    },
    {
        path: 'projects',
        component: ProjectsComponent,
        children: [
            { path: '', component: ProjectsHomeComponent },
            { path: 'add', component: ProjectsHomeComponent, data: { addProject: true } }
        ]
    },
    {
        path: 'job_templates',
        component: JobTemplatesComponent,
